import React from "react";
import WithData from "../HOC/WithData";
import ItemList from "../ItemList";
import {WithSwapi} from "../HOC/WithSwapi/WithSwapi";

const withChildFN = (Wrapper, FN) => {
    return (props) => {
       return <Wrapper {...props}>
            {FN}
        </Wrapper>
    }
}

const PersonList = WithSwapi(WithData(withChildFN(ItemList, ({name})=><span>{name}</span>)), mapPersonMethodsToProps);
const PlanetList = WithData(withChildFN(ItemList, ({name})=><span>{name}</span>));
const StarShipList = WithData(withChildFN(ItemList, ({name, model})=><span>{name} ({model})</span>));

export {
    PersonList,
    PlanetList,
    StarShipList
}
